import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import { connect } from 'react-redux';
import * as actions from '../actions';

import Header from './Header';
import Landing from './landing/Landing';
import Dashboard from './Dashboard';
import Footer from './Footer';
import Credentials from './credentials/Credentials';
import ContactUs from './landing/ContactUs';
import Services from './landing/Services';
import AboutUs from './landing/AboutUs';
import Schedule from './landing/Schedule';

const styles = {
	fontFamily: 'sans-serif',
	textAlign: 'center'
};



class App extends Component {
	componentDidMount() {
		this.props.fetchUser();
	}

	//handle different routes throughtout the app

	render() {
		/*return (
			<BrowserRouter>
				<div style={styles}>
					<div id="wrapper">
						<Header />
						<Route exact path="/" component={Landing} />
						<Route exact path="/Login" component={Credentials}  showSignUp="false" />
						<Route exact path="/SignUp" render={(props) => <Credentials {...props} showSignUp={true} />}/>
						<Route exact path="/ContactUs" component={ContactUs} />
						<Route exact path="/Services" component={Services} />
						<Route exact path="/AboutUs" component={AboutUs} />
						<Route exact path="/Schedule" component={Schedule} />
						<Route path="/Dashboard" component={Dashboard} />
						<Footer />
					</div>
				</div>
			</BrowserRouter>
		);
		*/
		return (
			<BrowserRouter>
				<div style={styles}>
					<div id="wrapper">
						<Header />
						<Landing />
					</div>
				</div>
			</BrowserRouter>
		)
	}

}

export default connect(null, actions)(App);
